sourcesContent:
console.log("Hello"); 
console.log("Apples");
console.log("This is a statement");
console.log("This is also a statement");

const myFunc = function () { 
    console.log("This statement is inside the function"); 
};
console.log("This statement is outside the function");
myFunc();
